import React from 'react';
import './App.css';
import Navigation from "./ui/menu/Navigation/Navigation";
import {BrowserRouter, Route, Routes, Navigate, Outlet} from "react-router-dom";
import {Terminal} from "./pages/Terminal/Terminal";
import {SwitchDetails} from "./pages/SwitchDetails/SwitchDetails";
import {Home} from "./pages/Home/Home";
function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <Navigation />
                <Routes>
                    <Route path=":dorm/:floor/:switch" element={<Outlet />}>
                        <Route path="/terminal" element={<Terminal />}></Route>
                        <Route path="" element={<SwitchDetails />}></Route>
                    </Route>
                    <Route path="" element={<Home />}></Route>
                    <Route path="" element={<Navigate to="" />}></Route>
                </Routes>
            </div>
        </BrowserRouter>
    );
}

export default App;
